import React, { useState, useRef, useEffect } from 'react';

// Fix the imports:
import { healthSearchService } from './services/healthSearchService'; // Changed import
import ImageUploadModal from './components/ImageUploadModal'; // Changed import (default import)
import MultiAuthLogin from './components/shared/components/MultiAuthLogin';
import Spinner from './components/Spinner';
import './styles/VHealthSearch.css';

interface VHealthSearchProps {
  // Define any props if needed
}

const VHealthSearch: React.FC<VHealthSearchProps> = () => {
  // State variables
  const [searchQuery, setSearchQuery] = useState('');
  const [searchResults, setSearchResults] = useState<any>(null);
  const [dataSource, setDataSource] = useState('');
  const [citations, setCitations] = useState<any[]>([]);
  const [isUploadModalOpen, setIsUploadModalOpen] = useState(false);
  const [isListening, setIsListening] = useState(false);
  const [showFeelingHealthyContent, setShowFeelingHealthyContent] = useState(false);
  const [imageError, setImageError] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [loadingMessage, setLoadingMessage] = useState('');

  // Refs
  const recognitionRef = useRef<any>(null);

  const handleSearch = async () => {
    if (!searchQuery.trim()) return;
    
    setIsLoading(true);
    setLoadingMessage('Analyzing with AI...');
    
    try {
      // Fix the method call:
      const results = await healthSearchService.searchHealthInfo(searchQuery);
      console.log('Health search results received:', results);
      
      if (results && (results.summary || results.details)) {
        console.log('Valid results confirmed');
        
        // Store results in sessionStorage to pass to SearchResults
        const searchData = {
          query: searchQuery,
          results: results,
          dataSource: 'openai',
          citations: results.sources || [],
          timestamp: new Date().toISOString()
        };
        
        sessionStorage.setItem('searchResults', JSON.stringify(searchData));
        console.log('Stored search data in sessionStorage:', searchData);
        
        console.log('Navigating to results page with data');
        // Use window.location.href for navigation
        window.location.href = `/results?q=${encodeURIComponent(searchQuery)}`;
      }
    } catch (error) {
      console.error('Search error:', error);
    } finally {
      setIsLoading(false);
    }
  };

  const handleAnalysisComplete = (imageName: string) => {
    setSearchQuery(imageName);
    setIsUploadModalOpen(false);
    // Trigger search with the image name
    handleSearch();
  };

  // Voice recognition setup
  useEffect(() => {
    if ('webkitSpeechRecognition' in window || 'SpeechRecognition' in window) {
      const SpeechRecognition = (window as any).webkitSpeechRecognition || (window as any).SpeechRecognition;
      const recognition = new SpeechRecognition();
      
      recognition.continuous = false;
      recognition.interimResults = false;
      recognition.lang = 'en-US';
      
      recognitionRef.current = recognition;
    }
  }, []);

  const handleVoiceInput = () => {
    if (!recognitionRef.current) {
      console.log('Speech recognition not available');
      return;
    }

    if (isListening) {
      recognitionRef.current.stop();
      setIsListening(false);
    } else {
      setIsListening(true);
      recognitionRef.current.start();
      
      recognitionRef.current.onresult = (event: any) => {
        const transcript = event.results[0][0].transcript;
        setSearchQuery(transcript);
        setIsListening(false);
      };
      
      recognitionRef.current.onerror = () => {
        setIsListening(false);
      };
      
      recognitionRef.current.onend = () => {
        setIsListening(false);
      };
    }
  };

  return (
    <div className="search-landing">
      {/* Spinner */}
      {isLoading && (
        <Spinner
          overlay={true}
          title="Analyzing with AI..."
          subtitle={loadingMessage}
          disableEsc={true}
        />
      )}
      
      {/* Login button */}
      <div style={{
        position: 'fixed',
        top: '20px',
        right: '20px',
        zIndex: 1000
      }}>
        <MultiAuthLogin className="main-login-button" />
      </div>

      <div className="search-container-centered">
        {/* Logo section */}
        <div className="logo-container">
          {!imageError ? (
            <img 
              src="/assets/wihylogo.png"
              alt="What is Healthy?"
              className="search-logo-image"
              onError={() => setImageError(true)}
              onLoad={() => setImageError(false)}
            />
          ) : (
            <h1 className="search-logo">
              What is Healthy?
            </h1>
          )}
        </div>
        
        {/* Search Input Container */}
        <div className="search-input-container">
          <textarea
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
            onKeyDown={(e) => {
              if (e.key === 'Enter' && !e.shiftKey) {
                e.preventDefault();
                handleSearch();
              }
            }}
            placeholder="Ask anything about health..."
            className="search-input"
            rows={1}
            disabled={isLoading}
          />
          
          <div className="search-icons">
            {/* Image upload button */}
            <button
              type="button"
              onClick={() => setIsUploadModalOpen(true)}
              className="icon-button"
              aria-label="Upload image"
              disabled={isLoading}
            >
              <svg viewBox="0 0 24 24" width="20" height="20">
                <path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm3.5 6L12 10.5 8.5 8 12 5.5 15.5 8zM7.5 9l4-2.5V9L7.5 9zm5 7.5V14l4 2.5-4 2.5zm5-7.5L13.5 6.5v3L17.5 9z"/>
              </svg>
            </button>

            {/* Voice input button */}
            <button
              type="button"
              onClick={handleVoiceInput}
              className={`icon-button ${isListening ? 'listening' : ''}`}
              aria-label={isListening ? 'Stop listening' : 'Start voice input'}
              disabled={isLoading}
            >
              <svg viewBox="0 0 24 24" width="20" height="20">
                <path d="M12 14c1.66 0 2.99-1.34 2.99-3L15 5c0-1.66-1.34-3-3-3S9 3.34 9 5v6c0 1.66 1.34 3 3 3zm5.3-3c0 3-2.54 5.1-5.3 5.1S6.7 14 6.7 11H5c0 3.41 2.72 6.23 6 6.72V21h2v-3.28c3.28-.48 6-3.3 6-6.72h-1.7z"/>
              </svg>
            </button>
          </div>
        </div>

        {/* Search button */}
        <button
          onClick={handleSearch}
          className="search-button"
          disabled={!searchQuery.trim() || isLoading}
        >
          {isLoading ? 'Searching...' : 'Search'}
        </button>
      </div>

      {/* Image Upload Modal - Fixed component usage */}
      <ImageUploadModal
        isOpen={isUploadModalOpen}
        onClose={() => setIsUploadModalOpen(false)}
        onAnalysisComplete={handleAnalysisComplete}
        title="Upload Image"
        subtitle="Upload images for analysis"
      />
    </div>
  );
};

export default VHealthSearch;

